import React from "react";

function Hobbies() {
  return (
    <div className="hobbies">
      <h2 className="corys-hobbies">My Hobbies</h2>
      <table>
        <tr>
          <th>Cycling</th>
        </tr>
        <tr>
          <th>DIY Projects</th>
        </tr>
      </table>
    </div>
  );
}
export default Hobbies;
